/*Table structure for table `insumos_proveedores` */

DROP TABLE IF EXISTS `insumos_proveedores`;

CREATE TABLE `insumos_proveedores` (
  `id` decimal(10,0) NOT NULL,
  `id_proveedor` decimal(10,0) NOT NULL,
  `id_insumo` decimal(10,0) NOT NULL,
  `nombre` varchar(40) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `insumos_proveedores_id_insumo` (`id_insumo`),
  CONSTRAINT `insumos_proveedores_ibfk_1` FOREIGN KEY (`id_insumo`) REFERENCES `insumos` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

