/*Table structure for table `maquinas_mant` */

DROP TABLE IF EXISTS `maquinas_mant`;

CREATE TABLE `maquinas_mant` (
  `id` decimal(10,0) NOT NULL,
  `id_maquina` decimal(10,0) DEFAULT NULL,
  `mantenimiento` varchar(40) DEFAULT NULL,
  `horas` decimal(6,0) DEFAULT NULL,
  `horas_aviso` decimal(6,0) DEFAULT NULL,
  `kilometros` decimal(6,0) DEFAULT NULL,
  `kilometros_aviso` decimal(6,0) DEFAULT NULL,
  `fecha_aviso` date DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `maquinas_mant_id` (`id`),
  KEY `maquinas_mant_id_maquina` (`id_maquina`),
  CONSTRAINT `maquinas_mant_ibfk_1` FOREIGN KEY (`id_maquina`) REFERENCES `maquinas` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

