  `usuario_ult_acceso` varchar(50) DEFAULT NULL,
  `fecha_ult_acceso` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

